                            </div>

                            <div
                                style={{
                                    height: "200vh",
                                    background: "linear-gradient(90deg, #005A5B 50%, #007369 50%)",
                                }}
                            >
                                <div class="flex ">
                                    <button
                                        className="mx-auto p-5 hover:scale-90"
                                        onClick={() => {
                                            setNo(1);
                                            setOpenTeacher1(true);
                                        }}
                                    >
                                        <svg fill="#ffff" version="1.1" id="Capa_1"
                                            width="80px" viewBox="0 0 31.312 31.312"
                                        >
                                            <g>
                                                <g>
